package com.ubt.myapplication;

import android.support.v7.app.AppCompatActivity;
import android.os.Bundle;
import android.util.Log;

import com.google.gson.Gson;
import com.ubt.myapplication.model.AccountBean;
import com.ubt.myapplication.model.AnnotationBean;
import com.ubt.myapplication.model.RequestBody;
import com.ubt.myapplication.network.NetClient;

import io.reactivex.Observer;
import io.reactivex.android.schedulers.AndroidSchedulers;
import io.reactivex.disposables.Disposable;
import io.reactivex.schedulers.Schedulers;

public class MainActivity extends AppCompatActivity {


    private String s1 = "";

    private String s2 = "";

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);
        faceAnno();

        getAccountInfo();
    }


    private void faceAnno() {
        RequestBody body = new RequestBody();
        body.setImage(s1 + s2);
        body.setToken_key("5D2JdDqVaDhy3P");
        body.setCamera_id(23);
        body.setOffice_id(1);
        body.setOrganization_id(1);
        body.setEmbeddings("");

        NetClient.getInstance().faceAnnotation(body).subscribeOn(Schedulers.io())
                .observeOn(AndroidSchedulers.mainThread()).subscribe(new Observer<AnnotationBean>() {
            @Override
            public void onSubscribe(Disposable d) {

            }

            @Override
            public void onNext(AnnotationBean annotationBean) {

                Log.d("chenqiang", "annotation == " + annotationBean.getLabelAnnotations().get(0).getAnnotation());

            }

            @Override
            public void onError(Throwable e) {

                Log.d("chenqiang", "on err " + e.getMessage());

            }

            @Override
            public void onComplete() {

            }
        });

    }


    private void getAccountInfo() {
        NetClient.getInstance().getAccountInfo("{\"uid\":\"123\"}")
                .subscribeOn(Schedulers.io())
                .observeOn(AndroidSchedulers.mainThread()).subscribe(new Observer<AccountBean>() {
            @Override
            public void onSubscribe(Disposable d) {

            }

            @Override
            public void onNext(AccountBean accountBean) {
                Log.d("chenqiang", "account == " + accountBean.getDs().get(0).getName());

            }

            @Override
            public void onError(Throwable e) {

            }

            @Override
            public void onComplete() {

            }
        });
    }
}
